import React, { useState, useEffect } from 'react';
import axios from '../utils/axios';
import '../styles/Home.css';

function Home() {
    const [securityProcess, setSecurityProcess] = useState({
        authentication: {
            status: 'pending',
            token: null,
            details: null
        },
        authorization: {
            status: 'pending',
            role: null,
            permissions: []
        },
        protectedAccess: {
            status: 'pending',
            message: null
        }
    });

    useEffect(() => {
        checkAuthenticationStatus();
    }, []);

    const checkAuthenticationStatus = async () => {
        const token = localStorage.getItem('token');
        if (token) {
            try {
                // 1. 토큰 디코딩 및 인증 상태 표시
                const tokenParts = token.split('.');
                const tokenPayload = JSON.parse(atob(tokenParts[1]));
                
                setSecurityProcess(prev => ({
                    ...prev,
                    authentication: {
                        status: 'success',
                        token: token,
                        details: tokenPayload
                    }
                }));

                // 2. 권한 확인
                setTimeout(() => {
                    setSecurityProcess(prev => ({
                        ...prev,
                        authorization: {
                            status: 'success',
                            role: tokenPayload.role || 'USER',
                            permissions: tokenPayload.authorities || []
                        }
                    }));
                }, 1000);

                // 3. 보호된 리소스 접근 테스트
                setTimeout(async () => {
                    try {
                        const response = await axios.get('/api/auth/protected');
                        setSecurityProcess(prev => ({
                            ...prev,
                            protectedAccess: {
                                status: 'success',
                                message: response.data
                            }
                        }));
                    } catch (error) {
                        setSecurityProcess(prev => ({
                            ...prev,
                            protectedAccess: {
                                status: 'error',
                                message: '접근 권한이 없습니다.'
                            }
                        }));
                    }
                }, 2000);

            } catch (error) {
                console.error('Token validation error:', error);
            }
        }
    };

    const SecurityStep = ({ title, status, details }) => (
        <div className={`security-step ${status}`}>
            <div className="step-header">
                <h3>{title}</h3>
                <span className={`status-badge ${status}`}>
                    {status === 'pending' ? '진행 중...' :
                     status === 'success' ? '성공' : '실패'}
                </span>
            </div>
            <div className="step-details">
                {details}
            </div>
        </div>
    );

    return (
        <div className="home-container">
            <h1>스프링 시큐리티 프로세스</h1>
            
            <div className="security-process">
                <SecurityStep
                    title="1. 인증 (Authentication)"
                    status={securityProcess.authentication.status}
                    details={
                        securityProcess.authentication.token ? (
                            <div className="token-info">
                                <p>✓ JWT 토큰 발급됨</p>
                                <p>사용자: {securityProcess.authentication.details?.sub}</p>
                                <p>만료시간: {new Date(securityProcess.authentication.details?.exp * 1000).toLocaleString()}</p>
                            </div>
                        ) : (
                            <p>로그인이 필요합니다.</p>
                        )
                    }
                />

                <div className="process-arrow">↓</div>

                <SecurityStep
                    title="2. 권한 부여 (Authorization)"
                    status={securityProcess.authorization.status}
                    details={
                        securityProcess.authorization.role ? (
                            <div className="auth-info">
                                <p>✓ 사용자 권한 확인됨</p>
                                <p>역할: {securityProcess.authorization.role}</p>
                                <p>권한: {securityProcess.authorization.permissions.join(', ') || '기본 사용자 권한'}</p>
                            </div>
                        ) : (
                            <p>권한 확인 중...</p>
                        )
                    }
                />

                <div className="process-arrow">↓</div>

                <SecurityStep
                    title="3. 보호된 리소스 접근"
                    status={securityProcess.protectedAccess.status}
                    details={
                        securityProcess.protectedAccess.message ? (
                            <div className="access-info">
                                <p>{securityProcess.protectedAccess.message}</p>
                            </div>
                        ) : (
                            <p>리소스 접근 확인 중...</p>
                        )
                    }
                />
            </div>
        </div>
    );
}

export default Home;
